/* Definition for the `CheckForUncompleteProductionRunByProductID` procedure : */

DELIMITER $$

CREATE DEFINER = 'root'@'localhost' PROCEDURE `CheckForUncompleteProductionRunByProductID`(
        IN `_productID` VARCHAR(50)
    )
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
SELECT productID, Completed from productionruns WHERE productID = _productID AND Completed = 0;
END$$

DELIMITER ;

/* Definition for the `Get_All_Material_Info` procedure : */

DELIMITER $$

CREATE DEFINER = 'root'@'localhost' PROCEDURE `Get_All_Material_Info`()
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
SELECT material.`MaterialPartNumber`, material.`MaterialName`, material.`Minimumlbs`,`materialINVENTORY`.lbs from Material JOIN `MaterialINVENTORY` ON `MaterialINVENTORY`.`materialpartnumber`=`Material`.materialpartnumber;
END$$

DELIMITER ;

/* Definition for the `Get_All_PFM_Info` procedure : */

DELIMITER $$

CREATE DEFINER = 'root'@'localhost' PROCEDURE `Get_All_PFM_Info`()
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
SELECT pfm.`PARTNUMBER`, pfm.`PARTNAME`, pfm.`PRODUCTID`,pfm.`MINIMUMQTY`,`PFMINVENTORY`.Qty from PFM JOIN `PFMINVENTORY` ON `PFMINVENTORY`.`partnumber`=pfm.partnumber;
END$$

DELIMITER ;

/* Definition for the `Get_All_ProductionRuns` procedure : */

DELIMITER $$

CREATE DEFINER = 'root'@'localhost' PROCEDURE `Get_All_ProductionRuns`()
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
Select * from productionruns;
END$$

DELIMITER ;

